Cookie={get:function(e){Shared.Debug.log("Cookie Getted"),e=e.toLowerCase();for(var o=document.cookie.split(";"),t=0;t<o.length;t++){var n=o[t].split("="),r=decodeURIComponent(n[0].trim().toLowerCase()),i=n.length>1?n[1]:"";if(r==e)return decodeURIComponent(i)}return null},set:function(e,o){Shared.Debug.log("Cookie Setted");var t=new Date;t.setYear(t.getFullYear()+1);var n=encodeURIComponent(e)+"="+encodeURIComponent(o)+";expires="+t.toGMTString()+";path=/";document.cookie=n},clear:function(e){Shared.Debug.log("Cookie Clear"),Cookie.set(e,"")},remove:function(e){Shared.Debug.log("Cookie Remove"),document.cookie=e+"=;expires=Thu, 01 Jan 1970 00:00:01 GMT;path=/"}};